import React, { Component } from 'react';
import './styles.scss';
import Needs from './../components/Needs';

export default function CreateProjectView() {
  return (
    <form>
      <label for='title'>Title</label>
      <input id='title' type='text' name='title' placeholder='Insert title here' />

      <label for='pictureUrl'>Picture</label>
      <input type='file' name='pictureUrl' id='pictureUrl' />

      <label for='description'>Description</label>
      <input
        id='description'
        type='text'
        name='description'
        placeholder='Insert description here'
      />

      <label for='location'>Description</label>
      <input id='location' type='location' name='location' placeholder='Insert location here' />

      <label for='needs'>Needs:</label>
      <input type='number' id='money' name='money' value='money' />
      <label>Resources</label>
      {<Needs />}
      <label>Volunteer</label>
      {<Needs />}
      <button>Submit</button>
    </form>
  );
}
